question_with_variants:
Given an electric field E=jAcos\omega (t - (z/c)) Determine the time-dependent magnetic intensityHin free space.

1) H= - {jA/ c\mu_0}sin\omega {t - (z/c)}
2) H= {iA/ c\mu_0}cos\omega {t - (z/c)}
3) H= {kA/ c\mu_0}cos\omega {t - (z/c)}
4) H= {kA/ c\mu_0}sin\omega {t - (z/c)}
5) H= - {iA/ c\mu_0}coscos\omega {t - (z/c)}
6) H= {jA/ c\mu_0}cos\omega {t - (z/c)}
7) H= - {iA/ c\mu_0}sin\omega {t - (z/c)}
8) H= {iA/ c\mu_0}coscos\omega {t - (z/c)}
9) H= {iA/ c\mu_0}sin\omega {t - (z/c)}
10) H= {iA\mu_0/c}sin\omega {t - (z/c)}
